import React, { Component } from 'react'

export default class Contacts extends Component {
    render() {
        let {id , name , code , price, onSale} = this.props.productDetails
        console.log(this.props); 
    return <>
                <div className='col-md-3'>
                    <div className="bg-white p-3 position-relative">
                    <h4>{id}</h4>
                    <h4>{name}</h4>
                    <h4>{code}</h4>
                    <h4>{price}</h4>
                    {onSale?<div className='bg-danger text-white top-0 end-0 position-absolute'>sale</div> : ''}
                    <button onClick={this.props.delete} className='btn btn'>delete</button>
                    </div>
                </div>
    </>
        
    } 
}
